INSERT INTO `think_article` VALUES (1,'使用操作说明',0,'20190926/725708b5131bddef810d457fce646442.jpg',' 操作流程 1.登录账号确认有余额 2、确认收款码 、银行卡 能正常收款 3、上架前确认选择正确收款码 4、发布广告选择对应金额 具体参考群内通知、5、不在电脑前操作 请勿一直挂单 5、没收到款 千万不要点击放行 6、收到款金额与订单不匹配请及时申诉、联系管理 ','使用操作说明详情','<p>&nbsp;操作流程 1.登录账号确认有余额 2、确认收款码 、银行卡 能正常收款 3、上架前确认选择正确收款码 4、发布广告选择对应金额 具体参考群内通知、5、不在电脑前操作 请勿一直挂单 5、没收到款 千万不要点击放行 6、收到款金额与订单不匹配请及时申诉、联系管理&nbsp;</p>',1,1,1,1,'','UWEB','',1566197983,1571382225),(3,'学习使用操作说明',23,'20191018/027c137dd76a14f432f120fe6b2f9026.png','学习操作说明','说明','<p>使用操作说明</p>',1,1,1,1,'','UWEB','',1571383725,1571383725);
